INSERT INTO `doc_notes` VALUES (1,'zzz','zz','1','0',NULL,NULL,'2020-418','2023-03-18 06:21:56','2023-03-18 14:54:07'),(2,'hahasha','hahaahha','1','0',NULL,NULL,'2020-418','2023-03-18 06:26:11','2023-03-18 14:54:11'),(3,'The standard Lorem Ipsum passage, used since the 1500s','\"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.\"','1','0','2023-03-2020-1-000002','document_notes','2020-1','2023-03-18 14:02:36','2023-03-18 14:53:42'),(4,'Section 1.10.32 of \"de Finibus Bonorum et Malorum\", written by Cicero in 45 BC','\"Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?\"','1','1','2023-03-2020-2-000001','document_notes','2020-1','2023-03-18 14:04:00','2023-03-18 14:04:00'),(5,'1914 translation by H. Rackham','\"On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.\"','1','1','2023-03-2020-1-000002','document_notes','2020-584','2023-03-18 14:12:19','2023-03-18 14:50:50'),(6,'Thank you!','We value your trust and confidence in us and sincerely appreciate you! Your commitment as a user is much appreciated. We look forward to serving you again in the future! DSSC ICTC would like to thank excellent users like you for your support.','1','0',NULL,NULL,'2020-1','2023-03-18 14:55:11','2023-03-22 08:09:23');
